import React, { useEffect, useState } from 'react';
import { getSales, deleteSale } from '../../services/api';
import { Link } from 'react-router-dom';

const SalesList = () => {
    const [sales, setSales] = useState([]);

    useEffect(() => {
        fetchSales();
    }, []);

    const fetchSales = async () => {
        try {
            const response = await getSales();
            setSales(response.data);
        } catch (error) {
            console.error('Failed to fetch sales:', error);
        }
    };

    const handleDelete = async (id) => {
        await deleteSale(id);
        fetchSales();
    };

    return (
        <div>
            <h1>Sales</h1>
            <Link to="/sales/new">Add Sale</Link>
            <ul>
                {sales.map(sale => (
                    <li key={sale.id}>
                        <strong>Sale ID:</strong> {sale.id} <br />
                        <strong>Human ID:</strong> {sale.human_id} <br />
                        <strong>Product ID:</strong> {sale.product_id} <br />
                        <strong>Outlet ID:</strong> {sale.outlet_id} <br />
                        <strong>Date:</strong> {sale.date} <br />
                        <strong>Price:</strong> ${sale.price} <br />
                        <strong>Quantity:</strong> {sale.quantity} <br />
                        <strong>Staff ID:</strong> {sale.staff_id} <br />
                        <button onClick={() => handleDelete(sale.id)}>Delete</button>
                    </li>
                ))}
            </ul>
        </div>
    );
};

export default SalesList;
